import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter } from 'react-router-dom';
import thunk from 'redux-thunk';
import { compose, combineReducers, createStore, applyMiddleware } from 'redux';
import { Provider } from 'react-redux';
import 'bootstrap/dist/css/bootstrap.min.css';

import { library } from '@fortawesome/fontawesome-svg-core';
import { faEye, faEyeSlash, faTrashAlt, faPlusCircle, faPlayCircle, faStopCircle } from '@fortawesome/free-solid-svg-icons';

import signinReducer from './store/reducers/signin';
import signupReducer from './store/reducers/signup';
import workoutsReducer from './store/reducers/workouts';

library.add( faEye, faTrashAlt, faPlusCircle, faPlayCircle, faStopCircle, faEyeSlash );


const composeEnhancers = process.env.NODE_ENV === 'development' ? window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ : null || compose;

const rootReducer = combineReducers({
  signin: signinReducer,
  signup: signupReducer,
  workouts: workoutsReducer
});

const store = createStore(rootReducer, composeEnhancers(
  applyMiddleware(thunk)
));

const app = (
    <Provider store={store}>
      <BrowserRouter>
          <App />
      </BrowserRouter>
    </Provider>
);


ReactDOM.render( app,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
